    "geo" : { },
    "id_str" : "999441936929800193",
    "text" : "Saw this: protected bike lanes aren\u2019t bike infra., they\u2019re car infra. Bikes don\u2019t need them, drivers need them so they don\u2019t kill bicyclists. \n\nGiven this understanding, shouldn\u2019t protected lane $$$ come from regular pub works street budget and not special (and tiny) bike budget?",
